Workflow for updating the contents of the app.R file: 
1. adjust the code in app.R and save file;
2. make sure there is a directory called 'docs' in the same folder where the app.R file and workspace are situated;
3. run the following command in the console: 'shinylive::export(appdir = ".", destdir = "docs")';
4. <optionally> run the following command in the console to test the app in a static webpage: 'httpuv::runStaticServer("docs/", port = 8008)';
5. commit or upload the new directory 'docs' from step 2 to the GitHub repository.
6. Open https://clazinusveijer.github.io/shinylive_BIA/

More information can be found at https://hbctraining.github.io/Training-modules/RShiny/lessons/shinylive.html
